(1, 'News', '1682856588banner.jpg', '1682856588promotion.jpg', 'North Construction & Building', 'Touker', '1682856588.jpg', 'A Year in Review - North Construction & Building', '1682856588user.jpg', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.\n\nThe standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.\nGiven the growth of North within Newcastle and the Hunter Valley, developing a local presence was a must. With the establishment of a Broadmeadow office in April this year, the company is now a local fixture. The new location is ideally positioned next door to the Master Builders Association of Newcastle and the Hunter Business Chamber – both of which North is a member.\n\n“It’s exciting times at North, having been involved in some of Newcastle’s most iconic projects such as the Merewether Surfhouse and Newcastle Light Rail,” declares Matthew Cook, North Director. “Our new facility is well located allowing us to strengthen current relationships, develop new connections, involve ourselves directly in the community and offer workspace to local staff.”\n\nTogether with North’s head office in Tuggerah, the office in Newcastle enables the company to create a cohesive service network, further strengthening their capabilities across regions and expanding the reach of their corporate culture and values.\n\nThe culture at North is considered to be the foundation on which the entire business is supported. It’s what is built on with every project and every client. North’s workforce is largely made up of long term employees who know and understand what working with North means, and who share the same values and goals. As such, it was paramount that North offer a place of work for its staff living in and around Newcastle and the Hunter Valley.\n\nTo further cement the company’s legitimacy as a local Newcastle construction company and testament to their success are the many construction awards won since 2004 including being three time winner of the prestigious Commercial Builder of the Year by the Master Builders Association Newcastle for 2011, 2016 and 2017.\n\nNorth is excited to participate, once again, in the MBA Newcastle annual awards. This year, the company has entered the following for consideration:\n\nCharlestown Community Mental Health Facility – Commercial Projects category, Gosford Substation – Industrial Building category, Hunter Valley Grammar School TAS Building – Public Building category, John Hunter Hospital Arch Project – interior & Shop Fitouts category, Singleton Hospital Expansion – Extensions, Renovations & Refurbishments category, St Bede’s Catholic College, Chisholm – Public Building category, Tuggerah Regional Sporting & Recreational Complex – Civil Engineering & Infrastructure category, Apprentice of the Year.', NULL, 1, 'As the Central Coast, Hunter Valley and Newcastle communities continue to grow, North Construction & Building will be there when it happens, just as they have been since 1987.', '2023-04-30 06:09:48', '2023-04-30 06:09:48');

