(1, 'Rabindra-Nazrul Jayanti 2022', NULL, '1673171448.jpg', '<p>In a time of overwhelming emotions, sadness, and pain, obligations.</p>', '2023-01-17', 0, NULL, '00:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '1673787752.jpg', 1, '2023-01-08 03:50:48', '2023-01-15 07:08:19'),
(2, 'Sri Sri Kali Puja – 2022', NULL, '1673171787.jpg', NULL, '2022-10-25', 0, 'Anandadhara Inc. Australia', '00:00:00', '+610450411366', 'anandadharasydaus@gmail.com', 'Ron Moore Community Centre', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, '2023-01-08 03:56:27', '2023-01-15 07:08:10'),
(3, 'Sharodio Durga Utsav 2022', 'Biggest Bengali Hindu Festival', '1673171803.jpg', '<p class=\"_04xlpA direction-ltr align-justify para-style-body\"><span class=\"S1PPyQ\">Dear Devotees and Friends,</span></p>\r\n<p class=\"_04xlpA direction-ltr align-justify para-style-body\"><span class=\"S1PPyQ\">Anandadhara will celebrate Saraswati Puja on 26th January 2023 at Kearns Community Hall. We cordially invite you and your family to celebrate this auspicious day with us and be blessed with knowledge and abundant wisdom by the divine Goddess.</span></p>\r\n<p class=\"_04xlpA direction-ltr align-end para-style-title\">&nbsp;</p>', '2022-10-01', 0, 'Anandadhara Inc. Australia', '00:05:00', '+61450411366', 'anandadharasydaus@gmail.com', 'Ron Moore Community Centre', '<ul>\r\n<li>Council Hall</li>\r\n<li>Puja Celebrations</li>\r\n<li>Cultural Program&nbsp;</li>\r\n<li>Lunch/Dinner</li>\r\n<li>Tea/Coffee/Snacks</li>\r\n<li>Kids Play ground and entertainment area</li>\r\n<li>Toilet and private car parks</li>\r\n</ul>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3306.5935475479055!2d150.8505225166243!3d-34.02864263480674!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6b12ec0ee6435ff3%3A0x82e77fe24a52151a!2sRon%20Moore%20Community%20Centre!5e0!3m2!1sen!2sau!4v1673783060660!5m2!1sen!2sau\" width=\"400\" height=\"300\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'All interested people will get an opportunity to celebrate Durga Puja', 'Represent the Bengali festival to Australian Community', NULL, NULL, NULL, '- Celebrate Bengali Festivals\r\n- Represent Bengali festivals to Australian Community', '1673577884.jpg', 1, '2023-01-08 03:56:43', '2023-01-16 06:46:04'),
(4, 'Saraswati Puja - 2023-removed', 'This is a public event and open for all. Event date is 26 Jan 2023', '1673171820.jpg', NULL, '2023-01-26', 0, 'Anandadhara Inc Australia', '12:00:00', '0450411366', 'mitra.prodip@gmail.com', 'Kearns Community Hall, 66 Kearns Ave, Kearns NSW 2558', NULL, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3306.8329472001287!2d150.80261021662415!3d-34.02249873448657!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6b12edd058e38919%3A0x2fb4f2ba14e2ac2!2sKearns%20Community%20Hall!5e0!3m2!1sen!2sau!4v1673783153628!5m2!1sen!2sau\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '- Any people can come and enjoy the festival', '- Puja Celebration\r\n- HateKhori for Kids\r\n- Cultural Program\r\n- Lunch and Dinner', NULL, NULL, NULL, '- Any people can come and enjoy the festival', '1673522847.png', 0, '2023-01-08 03:57:00', '2023-01-16 06:46:21'),
