(10, 'Saraswati Puja - 2023', '** HateKhori is open for all. Please let us know if you need any help.', '1674371764.png', '<p><strong>Anadadhara</strong> Inc. Australia will celebrate Saraswati Puja on 26th January 2023. It&rsquo;s a public event and open for all devotees.</p>\r\n<p><span style=\"color: #2dc26b;\"><em>** HateKhori is open for all. Please let us know if you need any help.</em></span></p>', '2023-01-26', 0, 'Anandadhara', '11:00:00', 'Prodip(0450411366), Shuvro(0430508620)', 'anandadharasydaus@gmail.com', 'Kearns Community Hall,  66 Kearns Ave, Kearns NSW 2558', '<ul>\r\n<li>Council Hall</li>\r\n<li>Puja Celebrations</li>\r\n<li>Cultural Program&nbsp;</li>\r\n<li>Lunch/Dinner</li>\r\n<li>Tea/Coffee/Snacks</li>\r\n<li>Kids Play ground and entertainment area</li>\r\n<li>Toilet and private car parks</li>\r\n</ul>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3306.8329472001287!2d150.80261021662415!3d-34.02249873448657!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6b12edd058e38919%3A0x2fb4f2ba14e2ac2!2sKearns%20Community%20Hall!5e0!3m2!1sen!2sau!4v1673788738916!5m2!1sen!2sau\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'Create an opportunity for interested people to celebrate Saraswati Puja together.', 'Celebrate and represent Bengali Festivals to the Australian multicultural society.', 'Event Mission', 'Event Vision', 'Our Vision', 'Celebrate and represent Bengali Festivals to the Australian multicultural society.', '1674612799.png', 1, '2023-01-15 07:20:11', '2023-03-07 07:13:26');

