(1, 'About', '/page/about', 'red', '1673787076.jpg', '<h3>&nbsp;</h3>\r\n<div class=\"liner-continer\"><hr />\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center; line-height: 1;\"><span style=\"color: #f1c40f;\"><code><span style=\"font-family: \'comic sans ms\', sans-serif;\"><span style=\"color: #236fa1;\"><span style=\"color: #e03e2d;\"><span style=\"font-size: 14pt;\">Anandadhara is established as a non-profit, charitable, cultural, educational, and religious organization within the meaning of Associations Incorporation Act 2009.The monogram of Anandadhara is an artwork which represents the stream of joy flowing through the world. The word &ldquo;Anandadhara&rdquo; is written in both English and Bangla to showcase the diversity in Australia.</span></span></span></span></code></span></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;<span style=\"color: #236fa1;\"><strong>\'Anandadhara\' if literally translated means a stream of joy. It is an emotion.&nbsp;</strong><strong>Look within yourself and you will find a part of Anandadhara in you!</strong></span></p>\r\n<p><strong>Anandadhara</strong>&nbsp;is formed to provide the Bengali and Indian Subcontinental diaspora of Sydney home for socio-cultural integration and support. Sydney and around, has a throbbing population with deep roots in Bengal and Indian subcontinent, comprising people from different walks of life. Anandadhara thrives to create bondage in this milieu through continuous engagement, dissemination of information, interaction, and support. Ensuring intermingling of the art, culture, music, knowledge, and experience in today&rsquo;s global village. We aim to celebrate our culture and traditions on one side; we endeavor to give back to the society in a meaningful way, on the other. Anandadhara embraces Australian Multicultural society in its endeavor while staying anchored to Bengali and Indian subcontinental traditions as a philosophy.</p>\r\n<p>The position of Anandadhara will always be based on our values and guiding principles. And we will always advocate for what we believe is rooted in Bengali heritage and Sanatan Dharma, and serves the well-being of Bengali and Indian Subcontinental Australians and the greater good of all.</p>\r\n<p>&lsquo;Anandadhara&rsquo; if literally translated means a stream of joy, and to promote happiness and harmonious blend of homely socializing integrated into Australian living is our motto. We thrive by welcoming new people in, fostering our integration into the wider Australian community, and cherishing our ethnic heritage in our adopted home.</p>\r\n<div class=\"liner-continer\">&nbsp;</div>\r\n<h4 class=\"woodmart-title-container title  wd-font-weight-500 wd-fontsize-xl\">Our Mission <img style=\"float: left;\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/aboutus.jpg\" width=\"202\" height=\"179\" /></h4>\r\n<hr /></div>\r\n<div class=\"title-after_title  set-cont-mb-s reset-last-child  wd-fontsize-s\">Anandadhara strives to enhance the cultural engagement and social heritage of all Bengali and Indian sub continental Australians towards the enrichment of the multi-cultural society in Australia.</div>\r\n<div class=\"title-after_title  set-cont-mb-s reset-last-child  wd-fontsize-s\">&nbsp;</div>\r\n<div class=\"title-after_title  set-cont-mb-s reset-last-child  wd-fontsize-s\">&nbsp;</div>\r\n<div class=\"title-after_title  set-cont-mb-s reset-last-child  wd-fontsize-s\">&nbsp;</div>\r\n<div class=\"title-after_title  set-cont-mb-s reset-last-child  wd-fontsize-s\">\r\n<div id=\"wd-61b07d8ed695f\" class=\"title-wrapper wd-wpb set-mb-s reset-last-child  wd-rs-61b07d8ed695f wd-title-color-default wd-underline-colored wd-title-style-default wd-width-100 text-left vc_custom_1638956443769\">\r\n<div class=\"liner-continer\">\r\n<h4 class=\"woodmart-title-container title  wd-font-weight-500 wd-fontsize-xl\" style=\"text-align: left;\">&nbsp;</h4>\r\n<h3 class=\"woodmart-title-container title  wd-font-weight-500 wd-fontsize-xl\"><img style=\"float: left;\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/about2.jpg\" width=\"243\" height=\"216\" /><strong>Our Vision</strong></h3>\r\n<hr /></div>\r\n</div>\r\n<div class=\"wpb_text_column wpb_content_element\">\r\n<div class=\"wpb_wrapper\">\r\n<ul>\r\n<li>&nbsp;&gt;&gt; Seeks to promote and develop Bengali and Indian subcontinental arts, music, literature and religious affairs through various initiatives in education and community services.</li>\r\n<li>&gt;&gt; To foster mutual respect and awareness among the members of different faiths and strengthen cultural harmony.</li>\r\n<li>&gt;&gt; Empower Sanatan (Hindu) Australian communities to live out the values of their faith through service and targeted advocacy work.</li>\r\n<li>&gt;&gt; Through the events that Anandadhara organizes, we share our rich Bengali and Indian subcontinental heritage with the rest of endeavor of Australia, whilst also performing a body of charitable activities to do our bit for the society at large, helping those who are most in need.</li>\r\n</ul>\r\n<div id=\"wd-61b07e585cfaf\" class=\"title-wrapper wd-wpb set-mb-s reset-last-child  wd-rs-61b07e585cfaf wd-title-color-default wd-underline-colored wd-title-style-default wd-width-100 text-left vc_custom_1638956651527\">\r\n<div class=\"liner-continer\">\r\n<h4 class=\"woodmart-title-container title  wd-font-weight-500 wd-fontsize-xl\">&nbsp;</h4>\r\n<h4 class=\"woodmart-title-container title  wd-font-weight-500 wd-fontsize-xl\"><img style=\"float: left;\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/value.jpg\" width=\"223\" height=\"198\" />Our Values</h4>\r\n<hr /></div>\r\n</div>\r\n<div class=\"wpb_text_column wpb_content_element\">\r\n<div class=\"wpb_wrapper\">\r\n<ul>\r\n<li>&gt;&gt; Ekatva: Oneness of all. We value and respect each other as individuals, work well together as a team.</li>\r\n<li>&gt;&gt; Be non-harming. We aspire to work and communicate fairly and respectfully.</li>\r\n<li>&gt;&gt; Be truthful. We pride ourselves on providing information with accuracy, integrity, and honesty.</li>\r\n<li>&gt;&gt; Be discerning. We approach our work through careful contemplation, reason, and consensus-building.</li>\r\n<li>&gt;&gt; Be innovative. We aspire to keep our work and approach relevant to our constituents by being creative, innovative, and flexible.</li>\r\n<li>&gt;&gt; Be collaborative. We seek out partnerships with other individuals and organizations to forward our mission and vision.<br />Selfless service. We act selflessly and help others in a variety of ways, without any reward or personal gain.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 1, NULL, 3, 1, '2023-01-03 04:48:19', '2023-01-19 19:11:56'),
