(3, 'Activities', '/all/activities', 'red', '1672919256.jpg', '<div class=\"container\">\r\n<div class=\"row content-layout-wrapper align-items-start\">\r\n<div class=\"site-content col-lg-12 col-12 col-md-12\" role=\"main\">\r\n<article id=\"post-24\" class=\"post-24 page type-page status-publish hentry\">\r\n<div class=\"entry-content\">\r\n<div class=\"vc_row wpb_row vc_row-fluid vc_row-o-equal-height vc_row-o-content-middle vc_row-flex\">\r\n<div class=\"wpb_column vc_column_container vc_col-sm-4\">\r\n<div class=\"vc_column-inner vc_custom_1538141927376\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_single_image wpb_content_element vc_align_center vc_custom_1643109886538\">\r\n<figure class=\"wpb_wrapper vc_figure\">\r\n<div class=\"vc_single_image-wrapper   vc_box_border_grey\"><img class=\"vc_single_image-img attachment-full\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/sarosoti.png\" sizes=\"(max-width: 408px) 100vw, 408px\" srcset=\"https://anandadhara.com.au/wp-content/uploads/2021/12/sarosoti.png 408w, https://anandadhara.com.au/wp-content/uploads/2021/12/sarosoti-300x235.png 300w\" alt=\"\" width=\"408\" height=\"320\" /></div>\r\n</figure>\r\n</div>\r\n<div class=\"info-box-wrapper\">\r\n<div id=\"wd-63304e45cf612\" class=\" wd-rs-63304e45cf612 wd-info-box woodmart-info-box wd-wpb text-center box-icon-align-top box-style- color-scheme-dark wd-bg-none box-title-default vc_custom_1664110165910\">\r\n<div class=\"info-box-content\">\r\n<h4 class=\"info-box-title title wd-font-weight- box-title-style-default wd-fontsize-m\">Saraswati Puja</h4>\r\n<div class=\"info-box-inner set-cont-mb-s reset-last-child\">\r\n<p><strong>Saraswati</strong>&nbsp;is the <a title=\"Hinduism\" href=\"https://en.wikipedia.org/wiki/Hinduism\">Hindu</a>&nbsp;<a title=\"Devi\" href=\"https://en.wikipedia.org/wiki/Devi\">goddess</a>&nbsp;of knowledge, music, art, speech, wisdom, and learning.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-4\">\r\n<div class=\"vc_column-inner vc_custom_1538141932185\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_single_image wpb_content_element vc_align_center vc_custom_1643109941520\">\r\n<figure class=\"wpb_wrapper vc_figure\">\r\n<div class=\"vc_single_image-wrapper   vc_box_border_grey\"><img class=\"vc_single_image-img attachment-full\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/pohela-hoshak.png\" sizes=\"(max-width: 408px) 100vw, 408px\" srcset=\"https://anandadhara.com.au/wp-content/uploads/2021/12/pohela-hoshak.png 408w, https://anandadhara.com.au/wp-content/uploads/2021/12/pohela-hoshak-300x235.png 300w\" alt=\"\" width=\"408\" height=\"320\" /></div>\r\n</figure>\r\n</div>\r\n<div class=\"info-box-wrapper\">\r\n<div id=\"wd-63304e7d85dc7\" class=\" wd-rs-63304e7d85dc7 wd-info-box woodmart-info-box wd-wpb text-center box-icon-align-top box-style- color-scheme-dark wd-bg-none box-title-default vc_custom_1664110215780\">\r\n<div class=\"info-box-content\">\r\n<h4 class=\"info-box-title title wd-font-weight- box-title-style-default wd-fontsize-m\">Pohela Boishak</h4>\r\n<div class=\"info-box-inner set-cont-mb-s reset-last-child\">\r\n<p><strong>Pohela Boishakh</strong> is the first day of the&nbsp;<a title=\"Bengali calendars\" href=\"https://en.wikipedia.org/wiki/Bengali_calendars\">Bengali calendar.</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-4\">\r\n<div class=\"vc_column-inner vc_custom_1538141937232\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_single_image wpb_content_element vc_align_center vc_custom_1643109929121\">\r\n<figure class=\"wpb_wrapper vc_figure\">\r\n<div class=\"vc_single_image-wrapper   vc_box_border_grey\"><img class=\"vc_single_image-img attachment-full\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/austrilina.png\" sizes=\"(max-width: 408px) 100vw, 408px\" srcset=\"https://anandadhara.com.au/wp-content/uploads/2021/12/austrilina.png 408w, https://anandadhara.com.au/wp-content/uploads/2021/12/austrilina-300x235.png 300w\" alt=\"\" width=\"408\" height=\"320\" /></div>\r\n</figure>\r\n</div>\r\n<div class=\"info-box-wrapper\">\r\n<div id=\"wd-63304df053b49\" class=\" wd-rs-63304df053b49 wd-info-box woodmart-info-box wd-wpb text-center box-icon-align-top box-style- color-scheme-dark wd-bg-none box-title-default vc_custom_1664110069697\">\r\n<div class=\"info-box-content\">\r\n<h4 class=\"info-box-title title wd-font-weight- box-title-style-default wd-fontsize-m\">Australian Day</h4>\r\n<div class=\"info-box-inner set-cont-mb-s reset-last-child\">\r\n<p><strong>Australia Day</strong>&nbsp;is the official&nbsp;<a title=\"National day\" href=\"https://en.wikipedia.org/wiki/National_day\">national day</a>&nbsp;of&nbsp;<a title=\"Australia\" href=\"https://en.wikipedia.org/wiki/Australia\">Australia</a>. Observed annually on 26 January.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"vc_row wpb_row vc_row-fluid vc_row-o-equal-height vc_row-o-content-middle vc_row-flex wd-rs-61c04b1f375e6\">\r\n<div class=\"wpb_column vc_column_container vc_col-sm-4\">\r\n<div class=\"vc_column-inner vc_custom_1538141942351\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_single_image wpb_content_element vc_align_center vc_custom_1643109953614\">\r\n<figure class=\"wpb_wrapper vc_figure\">\r\n<div class=\"vc_single_image-wrapper   vc_box_border_grey\"><img class=\"vc_single_image-img attachment-full\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/durga.png\" sizes=\"(max-width: 408px) 100vw, 408px\" srcset=\"https://anandadhara.com.au/wp-content/uploads/2021/12/durga.png 408w, https://anandadhara.com.au/wp-content/uploads/2021/12/durga-300x235.png 300w\" alt=\"\" width=\"408\" height=\"320\" /></div>\r\n</figure>\r\n</div>\r\n<div class=\"info-box-wrapper\">\r\n<div id=\"wd-63304edaca228\" class=\" wd-rs-63304edaca228 wd-info-box woodmart-info-box wd-wpb text-center box-icon-align-top box-style- color-scheme-dark wd-bg-none box-title-default vc_custom_1664110362138\">\r\n<div class=\"info-box-content\">\r\n<h4 class=\"info-box-title title wd-font-weight- box-title-style-default wd-fontsize-m\">Durga Puja</h4>\r\n<div class=\"info-box-inner set-cont-mb-s reset-last-child\">\r\n<p><strong>Durga Puja </strong>is an annual&nbsp;<a class=\"mw-redirect\" title=\"Hindu\" href=\"https://en.wikipedia.org/wiki/Hindu\">Hindu</a> festival.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-4\">\r\n<div class=\"vc_column-inner vc_custom_1538141956707\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_single_image wpb_content_element vc_align_center vc_custom_1643109976235\">\r\n<figure class=\"wpb_wrapper vc_figure\">\r\n<div class=\"vc_single_image-wrapper   vc_box_border_grey\"><img class=\"vc_single_image-img attachment-full\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/kali.png\" sizes=\"(max-width: 408px) 100vw, 408px\" srcset=\"https://anandadhara.com.au/wp-content/uploads/2021/12/kali.png 408w, https://anandadhara.com.au/wp-content/uploads/2021/12/kali-300x235.png 300w\" alt=\"\" width=\"408\" height=\"320\" /></div>\r\n</figure>\r\n</div>\r\n<div class=\"info-box-wrapper\">\r\n<div id=\"wd-633174379781a\" class=\" wd-rs-633174379781a wd-info-box woodmart-info-box wd-wpb text-center box-icon-align-top box-style- color-scheme-dark wd-bg-none box-title-default vc_custom_1664185412866\">\r\n<div class=\"info-box-content\">\r\n<h4 class=\"info-box-title title wd-font-weight- box-title-style-default wd-fontsize-m\">Kali Puja ( Diwali)</h4>\r\n<div class=\"info-box-inner set-cont-mb-s reset-last-child\">\r\n<p><strong>Kali Puja</strong>&nbsp;also known as&nbsp;<strong>Shyama Puja</strong> is a festival, dedicated to the&nbsp;<a title=\"Hinduism\" href=\"https://en.wikipedia.org/wiki/Hinduism\">Hindu</a>&nbsp;goddess&nbsp;<a title=\"Kali\" href=\"https://en.wikipedia.org/wiki/Kali\">Kali.</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"wpb_column vc_column_container vc_col-sm-4\">\r\n<div class=\"vc_column-inner vc_custom_1538141952550\">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"wpb_single_image wpb_content_element vc_align_center vc_custom_1643109964203\">\r\n<figure class=\"wpb_wrapper vc_figure\">\r\n<div class=\"vc_single_image-wrapper   vc_box_border_grey\"><img class=\"vc_single_image-img attachment-full\" src=\"https://anandadhara.com.au/wp-content/uploads/2021/12/bijoy.png\" sizes=\"(max-width: 408px) 100vw, 408px\" srcset=\"https://anandadhara.com.au/wp-content/uploads/2021/12/bijoy.png 408w, https://anandadhara.com.au/wp-content/uploads/2021/12/bijoy-300x235.png 300w\" alt=\"\" width=\"408\" height=\"320\" /></div>\r\n</figure>\r\n</div>\r\n<div class=\"info-box-wrapper\">\r\n<div id=\"wd-63317476c3dd1\" class=\" wd-rs-63317476c3dd1 wd-info-box woodmart-info-box wd-wpb text-center box-icon-align-top box-style- color-scheme-dark wd-bg-none box-title-default vc_custom_1664185612689\">\r\n<div class=\"info-box-content\">\r\n<h4 class=\"info-box-title title wd-font-weight- box-title-style-default wd-fontsize-m\">Bijoy Dibosh</h4>\r\n<div class=\"info-box-inner set-cont-mb-s reset-last-child\">\r\n<p><strong>Bijoy Dibosh </strong>is the &nbsp;<a class=\"mw-redirect\" title=\"\" href=\"https://en.wikipedia.org/wiki/Independence_of_Bangladesh\">Independence of Bangladesh</a> and is&nbsp;celebrated on 16 December.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</article>\r\n</div>\r\n</div>\r\n</div>', 1, NULL, NULL, 1, '2023-01-05 05:47:36', '2023-01-19 22:43:20'),
