(1, '1683345764.webp', 'makeup', NULL, 'North’s early contractor involvement (ECI) process is based on mutual trust between ourselves and clients. We approach this as a partnership where we fully disclose all preliminaries, subcontractor prices, our overheads and our margins. All completely open book.\r\n\r\nAs with everything at North, it’s all about trust for us.\r\n\r\nOur highly skilled ECI team works collaboratively across your project group providing guidance, cost saving recommendations, design alternatives and buildability resolutions as needed. We pride ourselves on being your trusted advisor from the very beginning.', '[\"16813810551.jpg\"]', 1, '2023-04-13 03:07:04', '2023-05-05 22:02:44'),
(2, '1683115834.webp', 'hair', NULL, 'The design and construction delivery method at North is tried and true. Our fully integrated team will develop and deliver an optimum plan with the most cost effective, sustainable and energy efficient design options to meet your needs.\r\n\r\nOur model allows you to deal with one entity throughout the life of the project from inception to delivery. By trusting our ability to integrate both our design expertise and building prowess you can be reassured of knowing project costs and timeframes at an early stage.\r\n\r\nWe’re proud to be the one entity that carries a project from concept to completion and work hard to exceed expectations.', '[\"16813811771.jpg\"]', 1, '2023-04-13 04:19:37', '2023-05-03 06:10:34'),
(3, '1683115775.jpg', 'massage', NULL, NULL, NULL, 1, '2023-05-03 06:09:35', '2023-05-03 06:09:35');

