(14, '2022-11-22 04:13:10', 'favicon', 'storage/setting/logo/prelaoder-logo.png', 1, '2023-01-14 01:11:16', '2023-05-03 02:06:08'),
(15, '2022-11-22 04:13:10', 'banner_image_back', 'storage/setting/logo/a1.jpg', 1, '2023-01-14 01:12:57', '2023-04-13 04:14:59'),
(16, '2022-11-22 04:13:10', 'banner_text_header', 'If you didn’t know, Here’s a bit about us.', 1, '2023-01-14 01:12:57', '2023-01-23 03:39:02'),
(17, '2022-11-22 04:13:10', 'banner_text_bottom', '<div style=\"text-align: left;\"><strong>Anandadhara</strong> is established as a non-profit, charitable, cultural, educational, and religious organization within the meaning of Associations Incorporation Act 2009 to provide the Bengali and Indian Subcontinental diaspora of Sydney home for socio-cultural integration and support.&nbsp;</div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div style=\"text-align: left;\">Anandadhara thrives to create bondage in this milieu through continuous engagement, dissemination of information, interaction, and support.</div>\r\n<div style=\"text-align: left;\">&nbsp;</div>\r\n<div style=\"text-align: left;\">We also believe - <em>&ldquo;No celebration is complete without sharing the happiness with others, especially the less privileged. Anandadhara truly believes in &ldquo;We Rise by Lifting Others&rdquo;. As part of that <span style=\"color: #236fa1;\"><span style=\"color: #3598db;\">we established a partnership with \"The Silver Coin Project\"</span>.</span></em></div>', 1, '2023-01-14 01:12:57', '2023-01-23 04:21:24'),
(18, '2022-11-22 04:13:10', 'work_image_1', 'storage/setting/logo/309643162_182005724351562_8461008438495582913_n.jpg', 1, '2023-01-14 01:13:48', '2023-01-23 06:52:44'),
(19, '2022-11-22 04:13:10', 'bottombanner_image', 'storage/setting/logo/activities.jpg', 1, '2023-01-14 01:14:43', '2023-01-24 20:12:11'),
