(21, '2022-11-22 04:13:10', 'about_image_1', 'storage/setting/logo/communitywork.jpg', 1, '2023-01-14 01:15:31', '2023-01-23 09:31:42'),
(22, '2022-11-22 04:13:10', 'about_text_bottom', 'Trusted by the biggest brand.', 1, '2023-01-14 01:15:31', '2023-01-14 01:15:31'),
(23, '2022-11-22 04:13:10', 'about_text_details', 'In-kind donations from our donors and partners allow us to do somethign good for the community. We are deeply grateful for those who have surprised us with their generosity.', 1, '2023-01-14 01:15:31', '2023-01-25 03:02:36'),
